        <input x-on:mouseup="sendRangesToDataLayer()" type="range" step="1" :min="min" :max="max" @input="minTrigger" wire:model.debounce.500ms="minDuration" x-model="from" class="w-full top-0 bottom-0 absolute m-auto outline-none pointer-events-none appearance-none bg-transparent" min="0" max="120">
        <input x-on:mouseup="sendRangesToDataLayer()" type="range" step="1" :min="min" :max="max" @input="maxTrigger" wire:model.debounce.500ms="maxDuration" x-model="to" class="w-full top-0 bottom-0 absolute m-auto outline-none pointer-events-none appearance-none bg-transparent" min="0" max="120">
    </div>
